import React from "react";
import { Table } from 'antd';
var columns = [{
  title: 'Name',
  dataIndex: 'name',
  width: 150
}, {
  title: 'Age',
  dataIndex: 'age',
  width: 150
}, {
  title: 'Address',
  dataIndex: 'address'
}];
var data = [];

for (var i = 0; i < 100; i++) {
  data.push({
    key: i,
    name: "Edward King ".concat(i),
    age: 32,
    address: "London, Park Lane no. ".concat(i)
  });
}

var Component = function Component() {
  return React.createElement(Table, {
    columns: columns,
    dataSource: data,
    pagination: {
      pageSize: 50
    },
    scroll: {
      y: 240
    }
  });
};

export default Component;
